import banner from "../assets/banner-buytuber.jpeg";

const BannerAds = () => {
  return (
    <a href="https://buytuber.com" target="_blank" rel="noreferrer">
      <div className="shadow my-4">
        <img src={banner} alt="banner buytuber" />
      </div>
    </a>
  );
};

export default BannerAds;
